  return (
    <View style={viewStyles.container}>
      <div style={{ justifyContent: "space-between", flex: 1 }}>
        <div style={{ backgroundColor: "yellow" }}>A</div>
        <div style={{ backgroundColor: "yellowgreen" }}>B</div>
